column5:
Okay, now it will only exit multi-line mode if newline is first character.

This allows for classes with multiple blocks of functions defined,
but need to indent with a spaces.

class Atom
   @x = 1
   @y = 2
   # indent with spaces, otherwise ends class in REPL.
   @z = (a,b) -> a + b

added expressions in range syntax and removed naked ranges. eg. 'x = 1;
y = 5; [x to y+2]' works now. Just '1 to 3' without brackets and not in
a for loop no longer works
